import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route,
} from 'react-router-dom'

import './App.css';
import Homepage from './pages/homepage'

class App extends Component {
  render() {
    return (
      <Router>
        <div className = "App">
        <Route path = "/" component = {homepage} exact />
      </div>
      </Router>
    )
  }
}

export default App
